import React from "react";
import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";
import "./GameMainMenu.css";

const GameMainMenu = () => {
    return (
        <>
            <Header />
            <main className="gm-container">
                {/* Back */}
                <button className="gm-back" type="button" aria-label="Go back">
                    ← <span>Go back</span>
                </button>

                {/* Start new quiz (hexagon) */}
                <button className="gm-cta" type="button">
                    Start new quiz
                </button>

                {/* Search bar */}
                <div className="gm-search">
                    <input
                        type="text"
                        placeholder="Search bar"
                        aria-label="Search quizzes"
                    />
                </div>

                {/* Library */}
                <section className="gm-library">
                    <div className="gm-library-placeholder">library</div>
                    {/* בעתיד תוכל למלא כאן כרטיסיות של קוויזים */}
                </section>
            </main>
            <Footer />
        </>
    );
};

export default GameMainMenu;
